import React from 'react';

const Navbar = () => (
    <ul id="menu">
        <li><a href="#">My Photographs</a></li>
        <li><a href="#">My Life</a></li>
        <li>
            <a href="#">Social Media ï¿¬</a>
            <ul class="hidden">
                <li><a href="#">Instagram</a></li>
                <li><a href="#">Facebook</a></li>
                <li><a href="#">Linked In</a></li>
            </ul>
        </li>
    </ul>
);

export default Navbar;
